name: Lumberjack Macaroni
servings: 6
source: Betty Crocker
categories: [main-dishes, pasta]
notes: |
  Mr. James Ford Bell, founder of General Mills, world traveler and epicure, actually made this dish for us himself in our test kitchen. It's one of his favorites.
  The original recipe calls for American cheese, but this substitutes sharp cheddar.
ingredients: |
  8 oz. boiled macaroni.
  2 cups grated sharp cheddar cheese (1/2 lb)
  2-4 tablespoons Worcestershire Sauce or more.
  1/4 cup chili sauce
  salt and pepper to taste
  3/4 cup piping hot melted butter
directions: |
  Spread out the macaroni on large, hot platter.
  Sprinkle with rest of ingredients, except butter.
  Pour butter over all, then mix with two forks until sauce is creamy.
